CREATE TABLE `articulos`  (
  `idarticulo` smallint NOT NULL AUTO_INCREMENT,
  `correlativo` varchar(8) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `idtipoarticulo` smallint NOT NULL,
  `idlaboratorio` smallint NOT NULL,
  `idunidadmedida` smallint NOT NULL,
  `idpresentacion` smallint NOT NULL,
  `descripcion` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL,
  `fotografia` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `disponible_compra` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0',
  `disponible_venta` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '0',
  `porcentaje_utilidad` decimal(9, 2) NULL DEFAULT 0.00,
  `observaciones` varchar(1000) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  `activo` char(1) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT '1',
  PRIMARY KEY (`idarticulo`) USING BTREE,
  INDEX `idtipoarticulo`(`idtipoarticulo` ASC) USING BTREE,
  INDEX `idlaboratorio`(`idlaboratorio` ASC) USING BTREE,
  INDEX `idunidadmedida`(`idunidadmedida` ASC) USING BTREE,
  INDEX `idpresentacion`(`idpresentacion` ASC) USING BTREE,
  CONSTRAINT `articulos_ibfk_1` FOREIGN KEY (`idtipoarticulo`) REFERENCES `tipo_articulo` (`idtipoarticulo`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `articulos_ibfk_2` FOREIGN KEY (`idlaboratorio`) REFERENCES `laboratorio` (`idlaboratorio`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `articulos_ibfk_3` FOREIGN KEY (`idunidadmedida`) REFERENCES `unidad_medida` (`idunidadmedida`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `articulos_ibfk_4` FOREIGN KEY (`idpresentacion`) REFERENCES `presentacion` (`idpresentacion`) ON DELETE CASCADE ON UPDATE CASCADE
) ENGINE = InnoDB DEFAULT CHARSET = utf8mb4 COLLATE = utf8mb4_general_ci ROW_FORMAT = Dynamic;

